use serde_json::{json, Value};

pub fn validate_country(country: &str) -> bool {
    let country_city_str = json_country_city();
    let data: Value = serde_json::from_str(country_city_str).unwrap();
    data.get(country).is_some()
}

pub fn validate_country_city(country: &str, city: &str) -> bool {
    let country_city_str = json_country_city();
    let data: Value = serde_json::from_str(country_city_str).unwrap();
    if let Some(country_data) = data.get(country) {
        if let Some(city_data) = country_data.as_array() {
            return city_data.contains(&json!(city));
        }
    }
    false
}

